import { configureStore } from "@reduxjs/toolkit";
import { missionTypes } from "./missionTypesSlice";
import { shift} from "./shiftSlice";

export default configureStore({
    reducer: {
        shift: shift.reducer,
        missionTypes: missionTypes.reducer
    }
})
